    useEffect(() => {
        setTimeout(() => {
            Animation.toggleDivHorizontal('cookie-dialog', true, 500, 0);
        }, 5000);
    }, []);

    return (
        <div id='cookie-dialog' className='cookie-dialog'>
            <div>
                <h3></h3>
                <p>We use cookies to ensure you have the best browsing experience on our website. By using our site, you acknowledge that you have read and understood our <a href=''></a> & Privacy Policy</p>
                <div></div>
            </div>
        </div>
    );
}

export default CookieDialog;
